import "./App.css";
// import {Button} from 'react-bootstrap'
import { BrowserRouter, Route } from "react-router-dom";

import Login from "./Login";
import AddProduct from "./AddProduct";
import Register from "./Register";
import UpdateProduct from "./UpdateProduct";

function App() {
  return (
    <div>
      <BrowserRouter>
        <h1>Electro-Mart</h1>
        <Route path="/login">
          <Login />
        </Route>
        <Route path="/register">
          <Register />
        </Route>
        <Route path="/add">
          <AddProduct />
        </Route>
        <Route path="/update">
          <UpdateProduct />
        </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
